import React from 'react';
import './App.css';
import Landing from './Components/Landing';
import Slider from './Components/Slider'

function App() {
  return (
    <div id="App">
      <div id="container1"><Landing /></div>
      <div id="container2"><Slider /></div>
    </div>
  );
}

export default App;
